import React from "react";
import App from "./App";
import About from "./Pages/About";

export default function Root() {
  return (
    <div className="todo-app-container">
      <nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </nav>
      <div className="content">
        <App />
        {/* <About /> */}
      </div>
    </div>
  );
}
